import React from "react";
import { Carousel } from "./components";

function HomePage() {
  return (
    <div className="bg-amazonclone-background">
      <div className="min-w-[1000px] max-w-[1500px] bg-slate-500">
        <Carousel />
      </div>
    </div>
  );
}

export default HomePage;
